import './assset/less/public.less'

import Echarts from 'echarts'
import { options } from 'less';

const echarts = Echarts.init(document.getElementById('app'));

const { random,floor } = Math;

const moonImg = 'image://data:image/png;base64,'
const lianhuaImg = 'image://data:image/png;base64,'
const kongmingDengImg = 'image://data:image/png;base64,'

const getRandomPoint = (num ,range = [[0,100],[60,100]]) => {
    const points = [];
    for(let i=0; i<num; i++){
        points.push([
            floor(random()*(range[0][1] - range[0][0])+range[0][0]),
            floor(random()*(range[1][1] - range[1][0])+range[1][0])
        ])
    }
    return points;
}
const stars = {
    name: "stars",
    type: "scatter",
    symbol:'diamond',
    silent:true,
    color:'#fff',
    symbolSize:4,
    itemStyle:{
        shadowColor: '#fff',
        shadowBlur:5
    },
    z:5,
    data: getRandomPoint(20)
}
const lightSpot = {
    name: "lightSpot",
    type: "scatter",
    color:'orange',
    silent:true,
    symbolSize:20,
    itemStyle:{
        opacity: .3,
        shadowColor: 'orange',
        shadowBlur:10
    },
    z:5,
    data: getRandomPoint(5,[[0,100],[20,50]])
}
const kongmingDeng = {
    name: "lightSpot",
    type: "scatter",
    color:'orange',
    silent:true,
    symbolSize:60,
    symbol:kongmingDengImg,
    itemStyle:{
        opacity: .7,
        shadowColor: 'orange',
        shadowBlur:10
    },
    z:5,
    data: getRandomPoint(4,[[0,100],[20,60]]),
    animationDurationUpdate: 1000,
    animationEasingUpdate: 'linear'
}
const lianhua = {
    name: "lightSpot",
    type: "scatter",
    color:'orange',
    silent:true,
    symbolSize:120,
    symbol:lianhuaImg,
    itemStyle:{
        opacity: .7,
        shadowColor: 'orange',
        shadowBlur:10
    },
    z:5,
    data: getRandomPoint(5,[[0,100],[0,20]])
}
const moon = {
    name: "moon",
    type: "scatter",
    symbol:moonImg,
    symbolSize:300,
    silent:true,
    itemStyle:{
        opacity: 1,
        shadowColor: '#fff',
        shadowBlur:10
    },
    label:{
        show:true,
        fontFamily:'',
        fontSize:50,
        color:'#1c4e59',
        formatter:'',
    },
    data: [[50,50]]
}

const text = {
    name: "text",
    type: "scatter",
    itemStyle:{
        show:false,
    },
    label:{
        show:true,
        fontFamily:'',
        fontSize:30,
        textBorderWidth:1,
        textBorderColor:'#000',
        color:'#fff',
        align:'center',
        formatter:'     \n \n \n \n \n    \n   ',
    },
    data: [[90,50]]
}

const option = {
    grid: [{
        show:true,
        containLabel:true,
        // backgroundColor:,
        left:0,
        right:0,
        top:0,
        bottom:0,
        borderWidth:0
    }],
    xAxis:{
        show:false,
        min:0,
        max:100,
    },
    yAxis:{
        show:false,
        min:0,
        max:100,
    },
    series:[
        stars,
        lightSpot,
        moon,
        lianhua,
        kongmingDeng,
        text
    ],
};
echarts.setOption(option);

let count = 0;

let timmer = setInterval(()=>{
    const lightSpotCycle = 10,
        step = 1,
        opacityStep =0.005;
    lightSpot.symbolSize += floor(count/lightSpotCycle) %2 === 0? step : -step;
    lightSpot.itemStyle.opacity += floor(count/lightSpotCycle) %2 === 0? -opacityStep : opacityStep;

    const kongmingDengCycle = 4,
        xStepRange = [0,1],
        yStep = 1;
    for(const i in kongmingDeng.data){
        let move = random()*(xStepRange[1]- xStepRange[0])+xStepRange[0];
        kongmingDeng.data[i][0] += floor(count/i+kongmingDengCycle) %2 === 0? move:-move;
        kongmingDeng.data[i][1] += yStep;

    }
    
    echarts.setOption(option)

    count ++;
},1000);